.skeleton {
  position: fixed;
  height: 100%;
  overflow: hidden;
  padding: 15px;
  box-sizing: border-box;
  background: #fff;
  width: 98%;
  top: 0;
}
.skeleton-nav {
  height: 110px;
  background: #eee;
  margin-bottom: 15px;
}
.skeleton-swiper {
  height: 440px;
  background: #eee;
  margin-bottom: 15px;
